import React from 'react'
import {SortableContainer, SortableElement} from 'react-sortable-hoc';

const SortableItem = SortableElement(({value}) => <li>{value}</li>);


export default function Todo({ todo }) {
    return (
        <div className="box">
            {/* <input type="checkbox"/> */}
            <span>{ todo.title }</span>
        </div>
    )
}

